    body: '{"texts": ["Carson City is the capital city of the American state of Nevada.
      At the  2010 United States Census, Carson City had a population of 55,274.",
      "The Commonwealth of the Northern Mariana Islands is a group of islands in the
      Pacific Ocean that are a political division controlled by the United States.
